  `date` datetime DEFAULT CURRENT_TIMESTAMP,
  `product_id` int(11) NOT NULL,
  `model_id` int(11) NOT NULL,
  `shop_id` int(11) NOT NULL,
  `price` double DEFAULT NULL,
  `product_url` varchar(300) DEFAULT NULL,
  `page_visits` int(11) DEFAULT NULL,
  `page_clicks` int(11) DEFAULT NULL,
  PRIMARY KEY (`price_entry_id`),
  KEY `product_id` (`product_id`),
  KEY `model_id` (`model_id`),
  KEY `shop_id` (`shop_id`),
  CONSTRAINT `price_history_ibfk_1` FOREIGN KEY (`product_id`) REFERENCES `products` (`product_id`),
  CONSTRAINT `price_history_ibfk_2` FOREIGN KEY (`model_id`) REFERENCES `models` (`model_id`),
  CONSTRAINT `price_history_ibfk_3` FOREIGN KEY (`shop_id`) REFERENCES `shops` (`shop_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9712 DEFAULT CHARSET=latin1;
